import React from 'react'
import { Link } from 'react-router-dom';





const LikePostsUsers = ({props}) => {
  let y =null;
  console.log(props)
  if(props){
    y = props.map((each) => {
        return(
            <div key={each[1]}>
                <Link to={`/shareme/profile/${each[1]}`}><p>{each[0]}</p></Link>
            </div>
        )
    })
  }
  return (
    <div>

        Likes:
        {y}

    </div>
  )
}

export default LikePostsUsers;
